import React, { Component } from 'react';

class Register extends Component {
    constructor(props) {
        super(props);

        this.state = {
            newStudent: {
                id: '',
                firstName: '',
                lastName: '',
                age: '',
                nationality: '',
            },
        }
    }

    render() {
        return (
            <div className="Register">
                <div className="container">
                    
                </div>
            </div>
        )
    }
}

export default Register;
